import jsPDF from "jspdf";

export const callAddFont = async function (divWidth, divHeight) {
let font = '';

	const orientation = window.innerWidth <= 768 ? 'portrait' : 'landscape';

    const receipt = new jsPDF(orientation, 'pt', [divWidth, divHeight]);

    // Load the font and add it to the VFS
    await receipt.addFileToVFS('Ticketing-normal.ttf', font);

    // Add the font to the PDF
    receipt.addFont('Ticketing-normal.ttf', 'Ticketing', 'normal');

    return receipt;
};
